import React from "react";

const UserList = () => {
  const Users = [
    { id: 1, name: "서건희" },
    { id: 2, name: "킹남대" },
    { id: 3, name: "권경혜" },
  ];

  const name = Users.map((user) => user.name);
  return name;
};

export default UserList;
